contracts/MultiContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

/* Graph of inheritance
    A
   / \
  B   C
 / \ /
F  D,E

*/

contract A {
    uint256 age;
    constructor(uint256 _age){
        age = _age;
    }
    function foo() public pure virtual returns (string memory) {
        return "A";
    }
}

// Contracts inherit other contracts by using the keyword 'is'.
contract B {
    
    uint256 ageB;
    constructor(uint256 _age){      
        ageB = _age;
    }

    function foo() public pure virtual returns (string memory) {
        return "B";
    }
}

contract C is A,B {
    
    uint256 ageC;
    constructor(uint256 _age) A(_age) B(_processCount(_age)){     
        ageC = _age;
    }

    function foo() public pure override (A,B) returns (string memory) {
        return "ABC";
    }

    function _processCount(uint256 initialCount) private pure returns (uint256) {
        // Perform some logic here
        return initialCount * 2; // Example: double the count
    }

    function viewA() public view returns (uint256){
        return age;
    }

    function viewB() public view returns (uint256){
        return ageB;
    }

    function viewC() public view returns (uint256){
        return ageC;
    }

}

